var _ = require('lodash');

//Give the next workers for the next 3 events or less if less programmed
export default function NextWorker(){

    var actual = -1;

    const [data, setData] = useState([
        {"event":"Pot des caves","position":{ "name":"Duplex", "lat":48.873658, "lng": 2.292500 },"couvreurs":["Emma"," Tara"]},
        {"event":"JOB","position":{ "name":"Palais royal", "lat":48.865045, "lng": 2.337404 },"couvreurs":["Eloi"," Thomas"]},
        {"event":"Afterwork JEECE","position":{ "name":"Square St Eloi", "lat":48.844737, "lng": 2.387503 },"couvreurs":["Nina"," Mathieux"]}
    ]);

    const createEventList = (i) => {
        return(
            <div className='event'>
                <h1 className='eventTitle'>{data[i].event}</h1>
                <h5 className='couvreurs'>Couvert par : {data[i]}</h5>
                <h5 className='position'>Lieu : {data[i].position.name}</h5>
            </div>
        )
    }

    const createList = () => {
        return data.map(createEventList());
    }

    var eventList = [];
    var eventListCode;

    useEffect(() => {
        console.log({data}.length);
        console.log(eventList);
        eventListCode = (JSON).stringify(eventList);
        console.log(eventListCode);
    }, []);

    return (

        <div className='container'>
            <eventList/>
        </div>

    );
    

}
